import React,{useState} from "react";
import time from '../assets/home/icons/Tours/time.svg';

export default function TimePicker () {
    const [hour,setHour] = useState(null);
    const [minute,setMinute] = useState(null);
    

    const Time = [
        {id:0,hour:"1:00 a.m",value:{hour:13,minute:0}},
        {id:1,hour:"2:00 a.m",value:{hour:14,minute:0}},
        {id:2,hour:"3:00 a.m",value:{hour:15,minute:0}},
        {id:3,hour:"4:00 a.m",value:{hour:16,minute:0}},
        {id:4,hour:"5:00 a.m",value:{hour:17,minute:0}}
    ];
    const changeTime = (time) => {
        setHour(time.hour);
        setMinute(time.minute);
    }
    
    return(
        <>
             <section className="custom_container">
                                <select>
                                    <option disabled selected><h3>Select the time</h3> </option> 
                                            {Time.map((hour)=> (
                                                    <option key={hour.id}>
                                                        {hour.hour} 
                                    </option>
                                            ))}
                                </select>
                                {formatHour(hour,minute)}
                                <img src={time}/>  
                            </section>
        </>
    )
}
